import React from 'react';
import CartIcon from './CartIcon';

const styles = {
    header:{
      width: '100%',
      height: '70px',
      backgroundColor: 'red',
      textDecoration: 'none'
    },
    
    nav:{
        listStyle:'none',
        display:'flex',
        position:'center'

    }
  }
const NavBar = (props) => {
    return (
        <header style={styles.header}>
            <nav className="containerItemList" style={styles.nav}> 
<li>Home</li>
<li>Products</li>
<li>About Us</li>
<div className="containerCart">
            <CartIcon height={40} width={40} fill={props.fill} />
        </div>
            </nav>

        </header>
    )
}


export default NavBar
